import React, { useState } from "react";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import TimePicker from 'react-time-picker';


const Form = () => {
  return (
    <form className="form flex">
      
    <div className="row">
        <input className="border" type="text" placeholder="Enter the task" />
      </div>

      <div className="row">
        <DatePicker className="full-center date-picker-manual" />
        <TimePicker className="" disableClock={true} />
        <input className="submit " type="submit" />
      </div>
    </form>
  );
};

export default Form;
